import "./share.css"

export default function Share() {
  return (
      <div className="share">
        <div className="shareWrapper">
        <div className="shareTop">
          <img src="/assets/person/" alt="" />
        </div>
        <div className="shareBottom"></div>
        </div>
      </div>
  )
}
